export default function SwedenMap() {
  const [selectedRegion, setSelectedRegion] = useState<(typeof regions)[0] | null>(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);

  const handleRegionClick = (region: (typeof regions)[0]) => {
    setSelectedRegion(region);
    setIsDialogOpen(true);
  };

  return (
    <div className="relative w-full h-full flex justify-center">
      <div className="relative w-full max-w-md md:max-w-lg lg:max-w-xl aspect-[3/4] bg-background">
        <svg viewBox="0 0 1000 1000" className="w-full h-full" aria-label="Map of Sweden with interactive regions">
          {Object.entries(simplemaps_countrymap_mapinfo.paths).map(([code, d]) => {
            const regionInfo = regions.find((r) => r.code === code);
            const fillColor = regionInfo ? 'rgba(0, 82, 147, 0.7)' : 'lightgray';
            return (
              <path
                key={code}
                d={d}
                fill={fillColor}
                stroke={regionInfo ? '#FECC02' : '#aaa'}
                strokeWidth="2"
                className={regionInfo ? 'cursor-pointer transition-all hover:fill-swedish-blue' : ''}
                onClick={regionInfo ? () => handleRegionClick(regionInfo) : undefined}
              />
            );
          })}
        </svg>

        <div className="absolute bottom-4 left-0 right-0 text-center text-sm text-muted-foreground">
          <p>Click on a circle to explore groups in that region</p>
          <p>Circle size represents the number of active groups</p>
        </div>
      </div>

      {/* Dialog for showing region details */}
      <Dialog open={isDialogOpen} onOpenChange={setIsDialogOpen}>
        <DialogContent className="max-w-md max-h-[80vh] overflow-auto">
          <DialogHeader>
            <DialogTitle>{selectedRegion?.name} Region</DialogTitle>
            <DialogDescription>{selectedRegion?.groups} active groups in this area</DialogDescription>
          </DialogHeader>

          <div className="space-y-4 mt-4">
            {selectedRegion?.activeGroups.map((group) => (
              <div key={group.id} className="border rounded-lg p-4 hover:bg-accent transition-colors">
                <div className="flex items-start gap-3">
                  <Avatar className="h-12 w-12">
                    <AvatarImage src={group.image || '/placeholder.svg'} alt={group.name} />
                    <AvatarFallback>{group.name.substring(0, 2)}</AvatarFallback>
                  </Avatar>

                  <div className="flex-1">
                    <h3 className="font-medium">{group.name}</h3>
                    <div className="flex flex-wrap gap-1 my-1">
                      {group.tags.map((tag) => (
                        <Badge key={tag} variant="secondary" className="text-xs">
                          {tag}
                        </Badge>
                      ))}
                    </div>
                    <div className="flex justify-between items-center mt-2 text-sm text-muted-foreground">
                      <span>{group.members} members</span>
                      <span>{group.nextEvent}</span>
                    </div>
                  </div>
                </div>
              </div>
            ))}

            <Button asChild className="w-full">
              <Link href="/app/discover">View All Groups in {selectedRegion?.name}</Link>
            </Button>
          </div>
        </DialogContent>
      </Dialog>
    </div>
  );
}
